import Vue from 'vue'
import App from './App.vue'
import Vuesax from 'vuesax'
import 'boxicons'
import vuetify from 'vuetify'

import 'vuesax/dist/vuesax.css' //Vuesax styles

// const vuetify = createVuetify({
//   components,
//   directives,
// })

Vue.use(Vuesax)
Vue.use(vuetify)


Vue.config.productionTip = false

new Vue({
  render: h => h(App),
}).$mount('#app')
